import React from 'react';
import './App.css';




function App() {
  const textStyle = {
    color: 'red'
  };

  return (
    <div className="container">
      <h1>Page with Text Boxes</h1>
      <form>
        <label style={{ marginBottom: '20px', marginTop: '20px', ...textStyle }}>
          Enter Item Address
          <br />
          <input type="text" name="Enter Item Address" style={textStyle} />
        </label>
        <br />
        <label style={{ marginBottom: '20px', marginTop: '20px', ...textStyle }}>
          Enter Item Price
          <br />
          <input type="text" name="Enter Item Price" style={textStyle} />
        </label>
        <br />
        <label style={{ marginBottom: '20px', marginTop: '20px', ...textStyle }}>
          Transaction Fee
          <br />
          <input type="text" name="Transaction Fee" style={{ padding: '10px', borderRadius: '5px', border: '1px solid #ccc', width: '150%' }} />
        </label>
        <br />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
